{"kill_chain_phase":{"type":"keyword","script":{"source":"// Safety Check: If rule.id doesn't exist, return 'Unknown'
if (doc['rule.id'].size() == 0) {
    emit('Unknown');
    return;
}

// Map Wazuh Rule IDs to Kill Chain Phases
String ruleId = doc['rule.id'].value;

if (ruleId == '100031' || ruleId == '100101' || ruleId == '100102') {
    emit('Discovery & Recon');
} else if (ruleId == '100003' || ruleId == '100004' || ruleId == '100020' || ruleId == '100021') {
    emit('Credential Access');
} else if (ruleId == '100005' || ruleId == '100110') {
    emit('Exploitation & Execution');
} else if (ruleId == '100010') {
    emit('Privilege Escalation');
} else if (ruleId == '100002') {
    emit('Initial Access (Success)');
} else {
    emit('Other / Noise');
}"}}}
